UPDATE `quest_template` SET `RequestItemsText`='Possessing a Cenarion Beacon allows one to sea a corrupted soul shard on those tainted beasts that are put down for the greater good. I grind shards into a usable reagent that goes into making Cenarion plant salve. We will use that salve to turn corrupted plants into healthy ones again.$b$bIn exchange for these shards, I will give you some Cenarion plant salves I have already prepared.' WHERE `entry` IN (4103,4108);
UPDATE `quest_template` SET `RequestItemsText`='If you possess a Cenarion beacon while mining in Felwood, you will be able to see tainted vitriol that corrupts a vein of raw metal. I know how to purify that vitriol and turn it into a reagent that goes into making Cenarion plant salve. You will then use that salve on plants you find in the wild that need saving.$b$bIf you have collected any tainted vitriol, I\'ll give you some Cenarion plant salve I have already prepared.' WHERE `entry` IN (4104,4109);
UPDATE `quest_template` SET `RequestItemsText`='A Cenarion beacon allows a seasoned herbalist to spot insidious fel creep - a malfeasant product of Felwood\'s corruption. My work here has taught me the knowledge of purifying fel creep into a cleansing reagent... used in what we now refer to as Cenarion plant salve.$b$bWhen you gather herbs in Felwood, you should encounter the fel creep so long as you have the beacon. In exchange for what you bring to me, I will give you pre-made Cenarion plant salve.' WHERE `entry` IN (4105,4110);
UPDATE `quest_template` SET `RequestItemsText`='A Cenarion beacon will allow a well-trained skinner to spot patches of tainted skin from bounty gathered in Felwood. I convert these seemingly useless patches into a thick paste that serves as a quickening agent for Cenarion plant salve. When you skin your kills here in Felwood, be sure to have a beacon on you!$b$bWhen you collect tainted patches, bring them to me and I will give you some Cenarion plant salves that I have already made.' WHERE `entry` IN (4106,4111);
UPDATE `quest_template` SET `RequestItemsText`='The power of a disenchanted magical item is felt by the essence it creates. I\'ve devised a way to turn raw essence used by enchanters into a suitable reagent for creating Cenarion plant salve. You don\'t need a Cenarion beacon for this; any suitably disenchanted item that yields lesser nether essences will work.$b$bI just need a single lesser nether essence; in exchange, I will give you Cenarion plant salves. The essence is extremely potent - a little definitely goes a long way!' WHERE `entry` IN (4107,4112);
UPDATE `quest_template` SET `RequestItemsText`='Well, here you are, $n - the completed Skeleton Key. I am certain as I can be that this key will allow you within the confines of the Scholomance. There\'s only one way to be absolutely sure it works, though. Waste no time in trying it out, I say.' WHERE `entry` IN (5505,5511);
