UPDATE `quest_template` SET `RequestItemsText`='Welcome $c. The Eye of Zuldazar pulses with energy. You are ready to take the next step. Hand me the talisman and I shall perform the imbue.' WHERE `entry`=8051;
UPDATE `quest_template` SET `RequestItemsText`='If only we had ten-thousand more like you, $n. The armies of Hakkar would be scattered to the wind in the blink of an eye.$b$b<Al\'tabim sighs.>$b$bAlas, the Eye is ready to realize its full potential. Give it to me.' WHERE `entry`=8052;
UPDATE `quest_template` SET `RequestItemsText`='Welcome back, $c. I can see that the pebble has seen much use. Many of our foes have fallen to your otherworldly abilities. Their suffering has been great. It is time that I enhance the power of the pebble. Give it to me. ' WHERE `entry`=8102;
UPDATE `quest_template` SET `RequestItemsText`='Hakkari fear you, $n. They speak of horrors they believed that only their faceless God could perpetrate. You have burned them with the force of Kajaro. They now know fear in two places.$b$bIt is time to further strengthen the pebble. Hand me the talisman.' WHERE `entry`=8103;
UPDATE `quest_template` SET `RequestItemsText`='Give me the talisman, $n. I must show you something.' WHERE `entry`=8104;
UPDATE `quest_template` SET `RequestItemsText`='Honor is earned amongst the Zandalar trolls, $n. With honor comes reward - friendship, alliance...$b$bHand me the talisman so that I may enhance its power.' WHERE `entry`=8107;
UPDATE `quest_template` SET `RequestItemsText`='I am ready for you, $c. Once more I will enhance your talisman. I only ask that you continue in your destruction of Hakkar and his minions.$b$bGive me the talisman.' WHERE `entry`=8108;
UPDATE `quest_template` SET `RequestItemsText`='Call forth your demons, $c. Let them bask in the energy of Kezan\'s Taint. Command them on the field of battle! Decimate the enemy!$b$bYes... The time has come to apply the final enhancement to Kezan\'s Taint. Give me the talisman.' WHERE `entry`=8109;
UPDATE `quest_template` SET `RequestItemsText`='Hey mon! It be good to see you again. The tribe be talking about your killin\' of the Hakkari and all that. Molthor gave me the word to be adding more mojo to your talisman. Just give it here and Maywiki make it better.' WHERE `entry`=8111;
UPDATE `quest_template` SET `RequestItemsText`='How be that talisman, mon? It look like it be time to add a little more magic and mojo to its leaves. It need a little bloom in its wilt. Give it here and Maywiki fix it right up.' WHERE `entry`=8112;
UPDATE `quest_template` SET `RequestItemsText`='$n! It been a long time since I seen you. Did you know that King Rastakhan himself be givin\' me the order to add the final bit of mojo and magic to your talisman? It be true, mon! I wouldn\'t have believed it had I not seen it with me own eyes. Give it here.' WHERE `entry`=8113;
UPDATE `quest_template` SET `RequestItemsText`='Good news, $n. Molthor be singin\' your praises lately. He say how you be turnin\' into a real hero of Zandalar.$b$bHe also say for Maywiki to polish your orb some more! Give it here so Maywiki can brighten the vision.' WHERE `entry`=8117;
UPDATE `quest_template` SET `RequestItemsText`='Sha-mon! Maywiki make a joke!$b$b<Maywiki laughs.>$b$bSo, you been using the spirits and elements against our enemies in Zul\'Gurub, eh? Spirits be praised!$b$bMaywiki gonna brighten your orb. Give it here, $n.' WHERE `entry`=8118;
UPDATE `quest_template` SET `RequestItemsText`='<Maywiki points to your talisman.>$b$bLook at it, $n! It\'s come alive. The spirits dance around the orb.$b$bGive it to Maywiki so she can make one last adjustment.' WHERE `entry`=8119;
UPDATE `quest_template` SET `RequestItemsText`='Impressive, $n. You have a gift for killing that I have not sensed in another in many years. Even Molthor is aware of the work that you have done for Zandalar. It is time to enhance your talisman further. Give it to me.' WHERE `entry`=8142;
UPDATE `quest_template` SET `RequestItemsText`='I sense that you have dealt countless fatalities to the Hakkari, $n. You carry the stink of their mojo.$b$bI assume the Shadow talisman has assisted in the culling? Give it to me and allow me to enhance its power.' WHERE `entry`=8143;
UPDATE `quest_template` SET `RequestItemsText`='It yearns to grow, $n. The talisman has soaked in all that you have done. The thousands of troll corpses littering Zul\'Gurub have fueled its power. Hand it to me and I shall make the final enhancement.' WHERE `entry`=8144;
UPDATE `quest_template` SET `RequestItemsText`='Even from here I can hear the sound of your volleys laying waste to our enemies. Their cries echo in agony.$b$bYou have made quite a name for yourself among the trolls of Zandalar, $n. We are grateful for all that you have done.$b$bHand me your talisman so that I may add another weave.' WHERE `entry`=8146;
UPDATE `quest_template` SET `RequestItemsText`='Ah, $n, it is good to smell you again.$b$b<Falthir grins.>$b$bYou\'ll have to excuse my sense of humor. It can be most foul at times.$b$bI sense that you have caused great anguish to our enemies. The forces of Hakkar cry out your name in anger. This is most excellent.$b$bYou have earned another weave on your talisman. Hand it to me.' WHERE `entry`=8147;
UPDATE `quest_template` SET `RequestItemsText`='Molthor delivers word from King Rastakhan, $n. The royal court is most impressed with your decimation of the Hakkari forces. I am to award you with the final weave in your talisman. Hand it to me.' WHERE `entry`=8148;
UPDATE `quest_template` SET `RequestItemsText`='Were ya drunk enough to see the little buggers?' WHERE `entry`=11431;
UPDATE `quest_template` SET `RequestItemsText`='Possessing a Cenarion Beacon allows one to sea a corrupted soul shard on those tainted beasts that are put down for the greater good. I grind shards into a usable reagent that goes into making Cenarion plant salve. We will use that salve to turn corrupted plants into healthy ones again.$b$bIn exchange for these shards, I will give you some Cenarion plant salves I have already prepared.' WHERE `entry` IN (5882,5887);
UPDATE `quest_template` SET `RequestItemsText`='If you possess a Cenarion beacon while mining in Felwood, you will be able to see tainted vitriol that corrupts a vein of raw metal. I know how to purify that vitriol and turn it into a reagent that goes into making Cenarion plant salve. You will then use that salve on plants you find in the wild that need saving.$b$bIf you have collected any tainted vitriol, I\'ll give you some Cenarion plant salve I have already prepared.' WHERE `entry` IN (5883,5888);
UPDATE `quest_template` SET `RequestItemsText`='A Cenarion beacon allows a seasoned herbalist to spot insidious fel creep - a malfeasant product of Felwood\'s corruption. My work here has taught me the knowledge of purifying fel creep into a cleansing reagent... used in what we now refer to as Cenarion plant salve.$b$bWhen you gather herbs in Felwood, you should encounter the fel creep so long as you have the beacon. In exchange for what you bring to me, I will give you pre-made Cenarion plant salve.' WHERE `entry` IN (5884,5889);
UPDATE `quest_template` SET `RequestItemsText`='A Cenarion beacon will allow a well-trained skinner to spot patches of tainted skin from bounty gathered in Felwood. I convert these seemingly useless patches into a thick paste that serves as a quickening agent for Cenarion plant salve. When you skin your kills here in Felwood, be sure to have a beacon on you!$b$bWhen you collect tainted patches, bring them to me and I will give you some Cenarion plant salves that I have already made.' WHERE `entry` IN (5885,5890);
UPDATE `quest_template` SET `RequestItemsText`='The power of a disenchanted magical item is felt by the essence it creates. I\'ve devised a way to turn raw essence used by enchanters into a suitable reagent for creating Cenarion plant salve. You don\'t need a Cenarion beacon for this; any suitably disenchanted item that yields lesser nether essences will work.$b$bI just need a single lesser nether essence; in exchange, I will give you Cenarion plant salves. The essence is extremely potent - a little definitely goes a long way! ' WHERE `entry` IN (5886,5891);

UPDATE `quest_template` SET `OfferRewardText`='What am I doing? What does it look like I\'m doing? I\'m devising a cure for your \'itis!\' Don\'t get indignant with me now, $n!$b$bJust a few more seconds. There! Just spray this, um, fantastic smelling medicine on yourself and you\'ll be as good as new.' WHERE `entry`=2609;
UPDATE `quest_template` SET `OfferRewardText`='Astounding! It must have taken weeks to gather those components... and how did you find a pristine hide?!?$b$bEnjoy the cap, $n!' WHERE `entry`=5063;
UPDATE `quest_template` SET `OfferRewardText`='Wow... you ARE da true $gking:queen;! I never think I see this gauntlet in my life! It look like it got no mojo left anymore... maybe that creepy elf try and ruin gauntlet. Well, I say HAR HAR to him!$b$bLook - this mark on da gauntlet an old old OLD timey magic mark, older than da Gordok they say. Well, as Captain of da Gordok, we all learn one thing over and over - how to make mark come to life and give power back to gauntlet!$b$bI do it for you, $gking:queen;! Here, take da gauntlet and rule FOREVER!' WHERE `entry`=7703;
UPDATE `quest_template` SET `OfferRewardText`='Your contribution is greatly appreciated, $c. It is only through the combined efforts of all that we shall be able to repel the ruthless advance of the silithid and whatever force is driving them forth. Even the Horde is amassing their own collection of purple lotus. Should you come across more, please return to me here.' WHERE `entry`=8505;
UPDATE `quest_template` SET `OfferRewardText`='Great work, $n. Please accept this on behalf of the Cenarion Circle. You\'ve certainly earned it, friend!' WHERE `entry` IN (8572,8574);
UPDATE `quest_template` SET `OfferRewardText`='Well, lookee there! Ye\'ve got yerself a right bushel o\' wolpertingers, ye do!$b$b<He takes a deep drink from his tankard.>$b$bI\'ll tell ye what I\'m gonna do. Since ye\'re such a spot-on $c, I\'ll let ye keep one\'a these fer yer very own!' WHERE `entry`=11117;
UPDATE `quest_template` SET `OfferRewardText`='Ya did good, kid. Here, take this as payment for the job ya did.' WHERE `entry`=11120;
UPDATE `quest_template` SET `OfferRewardText`='Oh, thank you! May the Light bless your good works, kind $glord:lady;. The shadow of the Dark Horseman yet looms, but at least, for now, the village is safe from his flames.' WHERE `entry`=11131;
UPDATE `quest_template` SET `OfferRewardText`='You have done well. It may seem a small act, but even this can aid the fight as a whole. Take this with my blessing, and return later, as I may have more for you to do.' WHERE `entry` IN (11947,11948,11952,11953,11954);
UPDATE `quest_template` SET `OfferRewardText`='My... my hat! But... how did you...?$b$bWell... no matter. So, now you know my secret. I WAS beaten... once. Here: take this hat, in return for mine. You\'ve earned it.' WHERE `entry`=12515;
UPDATE `quest_template` SET `OfferRewardText`='Very well then, here are your Cenarion plant salves. Scour Felwood for corrupted plants, $n! Wherever they are, use the salve I have given you to purify them.' WHERE `entry` IN (4103,4108);
UPDATE `quest_template` SET `OfferRewardText`='Very well then, here\'s some Cenarion plant salve. If you find more vitriol when you mine in Felwood, remember to hold on to it for me! The more of it you find, the more salve I will be able to make.' WHERE `entry` IN (4104,4109);
UPDATE `quest_template` SET `OfferRewardText`='Excellent work $n - every bit of this, once we purify it, will help us take back Felwood. Here, take some doses of Cenarion plant salve and head into the forest. The reclaiming of the land from the corruption waits for no $r!' WHERE `entry` IN (4105,4110);
UPDATE `quest_template` SET `OfferRewardText`='This is exactly what I need. Here - take these plant salves and use them to reclaim Felwood from the corruption. We must persevere, $n!' WHERE `entry` IN (4106,4111);
UPDATE `quest_template` SET `OfferRewardText`='Here are some Cenarion plant salves - I only need one lesser nether essence for this, $n. Essence is by far the most potent item I can make use of to turn swords into plowshares, as it were. If you need more salve, then find me here!' WHERE `entry` IN (4107,4112);
UPDATE `quest_template` SET `OfferRewardText`='Good luck, mighty hero. May your victories continue to bring you fame and power as you lay waste to Scholomance!' WHERE `entry` IN (5505,5511);
UPDATE `quest_template` SET `OfferRewardText`='Yes, I do believe you are ready...' WHERE `entry` IN (6066,6067);
UPDATE `quest_template` SET `OfferRewardText`='Yes, it is time for you to begin your training.' WHERE `entry` IN (6068,6069,6070);
UPDATE `quest_template` SET `OfferRewardText`='Yes, it is time, $c.' WHERE `entry` IN (6071,6073);
UPDATE `quest_template` SET `OfferRewardText`='Yes, I do believe you are ready, as well....' WHERE `entry` IN (6074,6075,6076);
UPDATE `quest_template` SET `OfferRewardText`='Ho ho hello, adventurer!$b$bThe goblins told me that you have earned a special gift this holiday season, and I am pleased to give it to you. Here you go - have a wondrous Feast of Winter Veil this and every season in the future.' WHERE `entry`=7045;
UPDATE `quest_template` SET `OfferRewardText`='Hail, $c. I am Jin\'rokh the Breaker, troll of Mugamba. We of the Zandalar tribe recognize your accomplishments. We salute your tenacity and strength of will.$b$bWear this talisman around your neck, $c. Let the strength of Mount Mugamba flow through your being. Be empowered as you strike down our enemies!' WHERE `entry`=8041;
UPDATE `quest_template` SET `OfferRewardText`='Our paths will cross again, $c.' WHERE `entry`=8042;
UPDATE `quest_template` SET `OfferRewardText`='Use your newfound strength to destroy the Gurubashi!' WHERE `entry`=8043;
UPDATE `quest_template` SET `OfferRewardText`='Zul\'jin would be envious, $c. Go forth and conquer!' WHERE `entry`=8044;
UPDATE `quest_template` SET `OfferRewardText`='Know this, heathen: A catastrophe has brought us together. Your pagan ways are neither understood nor appreciated by Zandalar but we are a fair people. Wear this brand around your neck. It shall serve as both a warning to our enemies and a symbol of your friendship to Zandalar.$b$bContinue to serve our people and I will amplify the power of the brand.' WHERE `entry`=8045;
UPDATE `quest_template` SET `OfferRewardText`='Do what you must to defeat our enemies, $c. Even if it means channeling the Light.$b$b<Jin\'rokh shudders.>' WHERE `entry`=8046;
UPDATE `quest_template` SET `OfferRewardText`='Our beliefs differ but our cause is righteous. Strike down our foes, noble $c.' WHERE `entry`=8047;
UPDATE `quest_template` SET `OfferRewardText`='Vigilance, honor, loyalty, bravery... You embody all of these traits and so shall your brand.' WHERE `entry`=8048;
UPDATE `quest_template` SET `OfferRewardText`='Accept this talisman as a token of our appreciation, $c.$b$bThe Eye of Zuldazar will grow in power as your bond with the trolls of Zandalar strengthens. Return to me periodically and I shall imbue the jewel. ' WHERE `entry`=8049;
UPDATE `quest_template` SET `OfferRewardText`='Be resolute in your endeavors, $n. The Soulflayer will attempt to siphon your will to live.' WHERE `entry`=8050;
UPDATE `quest_template` SET `OfferRewardText`='Continue in your battle against the Soulflayer and his minions, $n. He must never be permitted to leave the confines of Zul\'Gurub.' WHERE `entry`=8051;
UPDATE `quest_template` SET `OfferRewardText`='Smite them all and let Hakkar sort them out...' WHERE `entry`=8052;
UPDATE `quest_template` SET `OfferRewardText`='$R, the pebble held within the frame of this talisman comes from Mount Kajaro in the South Seas. Mount Kajaro is an area plagued by volatility - marked by violent and oftentimes magical volcanic eruptions.$b$bAs your bond with the trolls of Zandalar grows, so too shall the power of this pebble. Harness the power of the pebble to strike down our enemies. Be like the mountain: Quick, explosive, deadly...' WHERE `entry`=8101;
UPDATE `quest_template` SET `OfferRewardText`='Be unstoppable, like the molten fronts of Kajaro.' WHERE `entry`=8102;
UPDATE `quest_template` SET `OfferRewardText`='Continue in your decimation of the trolls of Zul\'Gurub. Hakkar must see that the world will not buckle beneath his indomitable will.' WHERE `entry`=8103;
UPDATE `quest_template` SET `OfferRewardText`='<Al\'tabim shatters the pebble with a powerful unseen force.>$b$bDo you see? The pebble is what we call a geode. Inside the pebble are powerful crystals that have been soaking in the latent energies from our world. By cutting the pebble in half, I have finally allowed its full potential to be realized. Use it to lay waste to our enemies.' WHERE `entry`=8104;
UPDATE `quest_template` SET `OfferRewardText`='Accept this talisman, $c. Accept it and use its power to strike down our mutual enemies.$b$bKnow that around your neck you carry a piece of history. Kezan was once a grand territory of the Zandalar Empire. Alas, the taint of goblin trade princes would force out my proud brothers and sisters.$b$bKezan is now home to the goblin capital of the Undermine; but know that before the taint, it held greatness. Still to this day Kezan is considered sacred land to my people.' WHERE `entry`=8106;
UPDATE `quest_template` SET `OfferRewardText`='Draw from the darkness, $c. Embrace the shadows. Let Kezan\'s Taint supplement your dark meddling.' WHERE `entry`=8107;
UPDATE `quest_template` SET `OfferRewardText`='It is only through our combined efforts that we will stop the Soulflayer.' WHERE `entry`=8108;
UPDATE `quest_template` SET `OfferRewardText`='Flay the flesh from their corpses. Watch as the shadows consume the Hakkari. Draw power from their fear, $c. Let Kezan\'s Taint augment this power...' WHERE `entry`=8109;
UPDATE `quest_template` SET `OfferRewardText`='See this here seaweed, mon? It be from the South Seas. We just add a little mojo and a little magic and it takes on the properties most suited to its owner.$b$bYou a $c so it be easy, mon. Just wrap it around your neck and think of nature or squirrels or whatever it be that you people like.' WHERE `entry`=8110;
UPDATE `quest_template` SET `OfferRewardText`='The neck piece not be for smokin\', mon! You got to use it to fight evil.' WHERE `entry`=8111;
UPDATE `quest_template` SET `OfferRewardText`='Now you take the evil trolls in Zul\'Gurub and show them what your nature powers can do, mon!' WHERE `entry`=8112;
UPDATE `quest_template` SET `OfferRewardText`='$n mon, it been a good journey. Keep on with the killing and suppressing of Hakkar and he minions.' WHERE `entry`=8113;
UPDATE `quest_template` SET `OfferRewardText`='You and Maywiki have something in common, mon. We both be $c! Although, Maywiki is more of a mystic and you be more of a scrub. Still, we both know what the great spirits bring.$b$bAs a gift I give to you this orb to wear around your neck. Look deep inside and see the village of Voodress in the South Seas! Let it lift your spirits!' WHERE `entry`=8116;
UPDATE `quest_template` SET `OfferRewardText`='Beware the evil Hakkari spirits, mon. Honestly, they be spooky.' WHERE `entry`=8117;
UPDATE `quest_template` SET `OfferRewardText`='Take a look at it now, $n. Voodress come in even clearer now, yea? Let the primal power flow through you, mon.' WHERE `entry`=8118;
UPDATE `quest_template` SET `OfferRewardText`='One day, $n, you will be able to use this orb to communicate directly with me. Whenever this battle with Hakkar be over and Maywiki go home. Let us call to the spirits and ask them for that day to come soon.' WHERE `entry`=8119;
UPDATE `quest_template` SET `OfferRewardText`='You progress swiftly, young $c. Perhaps it is time to initiate you into the Shera Ali\'kh - Zandalari for Death\'s Hand. For thousands of years we have played the role of assassin for the Zandalar Empire. For too long we have sat idly, allowing the Hakkari to grow in strength. Once more we face Hakkar, but this time without the support of a united $r front. It is you and your allies who must assist in vanquishing the Blood God and his minions!$b$bWear this talisman and let it assist you in your journeys.' WHERE `entry`=8141;
UPDATE `quest_template` SET `OfferRewardText`='There is only one enhancement left that can be placed on the talisman, $c. When the time is right, I shall apply that enhancement.' WHERE `entry`=8142;
UPDATE `quest_template` SET `OfferRewardText`='An assassin of your caliber should be given a wide berth. Your foes must learn respect! You will get just that when the enemy sees the glint of Death\'s Hand - all too late...' WHERE `entry`=8143;
UPDATE `quest_template` SET `OfferRewardText`='This is the last time we will speak under the auspices of Shera Ali\'kh. You know all that you must. Take the talisman and continue in your slaying. Hakkar must never be allowed to leave Zul\'Gurub.' WHERE `entry`=8144;
UPDATE `quest_template` SET `OfferRewardText`='Amongst the Zandalarians, the profession of $c is revered. Our greatest hunters travel to the edge of the Maelstrom to prove their resolution.$b$bFrom the heart of the sea they pull strands of kelp known as Maelstrom Tendrils. The kelp is then woven into a talisman that is enchanted to improve their accuracy and power.$b$bI now grant you a single weaving of the Maelstrom\'s Tendril. As your bond with Zandalar grows, I shall weave more power into the talisman.' WHERE `entry`=8145;
UPDATE `quest_template` SET `OfferRewardText`='There is only one more weave that I will be able to add to your talisman, $c' WHERE `entry`=8146;
UPDATE `quest_template` SET `OfferRewardText`='Let them seek atonement at the end of your munitions.' WHERE `entry`=8147;
UPDATE `quest_template` SET `OfferRewardText`='Your journey has only just begun, young $c. Perhaps one day you will visit the Maelstrom and glance into the heart of the world.$b$bI wish you power and fortitude!' WHERE `entry`=8148;
UPDATE `quest_template` SET `OfferRewardText`='He is redeemed, $n. He now returns to the Dream to right what he alone has done wrong. Eranikus will be a powerful ally to Malfurion and my father.$b$bThese armaments are for you, $n; given to me by Ysera herself. You would do well to make use of them in your battles against the Qiraji.' WHERE `entry`=8736;
UPDATE `quest_template` SET `OfferRewardText`='Well, lookee there! Ye\'ve got yerself a right bushel o\' wolpertingers, ye do!$b$b<He takes a deep drink from his tankard.>$b$bI\'ll tell ye what I\'m gonna do. Since ye\'re such a spot-on $c, I\'ll let ye keep one\'a these fer yer very own!' WHERE `entry`=11431;
UPDATE `quest_template` SET `OfferRewardText`='Hey, that wasn\'t too bad... are you sure you\'re not a dwarf?$b$bSo there\'s plenty more racing to be had and it\'s not just from me. All over the Brewfest grounds you\'ll find people in need of a decent ram racer. So go and make yourself useful.$b$bOh and don\'t forget, these rams were legally obtained. I just want to make sure we\'re clear.' WHERE `entry`=11409;
UPDATE `quest_template` SET `OfferRewardText`='Nice work there! It takes time to get the hang of controlling your ram. But once you do, you\'ll wish every ram was a racing ram.$b$bWhat\'s that? \"Where\'s my reward?\" Ha Ha Ha... you got to ride the fastest ram around! You want more? Well how about this...$b$bYou\'ve been rewarded with the chance to help other people around Brewfest. There\'s plenty of work, and rewards, for an eager, young, ram racer.' WHERE `entry`=11318;
UPDATE `quest_template` SET `OfferRewardText`='Will you lay the candle down and call the Headless Horseman from his doomed rest?' WHERE `entry`=11404;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $n! Children, take a good look at this $c. Grow strong and brave like him and one day you too will fight for the Horde.' WHERE `entry`=11361;
UPDATE `quest_template` SET `OfferRewardText`='Well done, $n. Children, take a good look at this $c. Let her be a strong example to you.' WHERE `entry`=11449;
UPDATE `quest_template` SET `OfferRewardText`='Very well then, here are your Cenarion plant salves. Scour Felwood for corrupted plants, $n! Wherever they are, use the salve I have given you to purify them.' WHERE `entry` IN (5882,5887);
UPDATE `quest_template` SET `OfferRewardText`='Very well then, here\'s some Cenarion plant salve. If you find more vitriol when you mine in Felwood, remember to hold on to it for me! The more of it you find, the more salve I will be able to make.' WHERE `entry` IN (5883,5888);
UPDATE `quest_template` SET `OfferRewardText`='Excellent work $n - every bit of this, once we purify it, will help us take back Felwood. Here, take some doses of Cenarion plant salve and head into the forest. The reclaiming of the land from the corruption waits for no $r!' WHERE `entry` IN (5884,5889);
UPDATE `quest_template` SET `OfferRewardText`='This is exactly what I need. Here - take these plant salves and use them to reclaim Felwood from the corruption. We must persevere, $n!' WHERE `entry` IN (5885,5890);
UPDATE `quest_template` SET `OfferRewardText`='Here are some Cenarion plant salves - I only need one lesser nether essence for this, $n. Essence is by far the most potent item I can make use of to turn swords into plowshares, as it were. If you need more salve, then find me here!' WHERE `entry` IN (5886,5891);

